import React from "react";
import "./navbar.css";

function TopicBadge({ topic }) {
  const url = `/events/topics/${topic}`;
  return (
    <a href={url}>
      <span className="badge topic-badge m-1">{topic}</span>
    </a>
  );
}

export default TopicBadge;
